import React, { Component } from 'react';
import "./index.css";

const listStyle = {
  marginLeft: "50px"
};

class About extends Component {
  render() {
    return (
      <div className="aboutDiv">
        <p><span id="break">|&nbsp;</span><span>Theme&nbsp;:</span>&nbsp;"Perseverance"</p>
        <p id="textBody">
          <span style={{fontStyle:"italic"}}>I have fought the good fight, I have finished the race, I have kept the faith. - 2 Timothy 4:7</span>
          <br></br>
          This is the awesome theme for Winter Retreat 2018. It is awesome because it is from the Bible and the Bible is really cool and awesome. This
          verse embodies perseverance in our walk with Jesus.
        </p>
        <p><span id="break">|&nbsp;</span><span>When&nbsp;:</span>&nbsp;Friday, December 28th to Monday, December 31st 2018</p>
        <p id="textBody">
          <ul style={listStyle}>
            <li>Check-in 3:00pm to 4:00pm on December 28th</li>
            <li>Check-out 6:30pm on December 31st</li>
          </ul>
        </p>
        <p><span id="break">|&nbsp;</span><span>Where&nbsp;:</span>&nbsp;Cohutta Springs Conference Center</p>
        <p id="textBody">
          <ul style={listStyle}>
            <li>Check-in 3:00pm to 4:00pm on December 28th</li>
            <li>Check-out 6:30pm on December 31st</li>
          </ul>
        </p>
      </div>
    )
  };
};

export default About;
